import { useState } from 'react'
import axios from 'axios'
import Chart from 'chart.js'

var count = 1
const Views = () => {
    const [integers, setIntegers] = useState([])

    async function fetchAllInts(){
        try {
            let response = await axios.get("http://localhost:8800/data/1");
            console.log(response);
            setIntegers(response.data);
            if (count === 50){
                count = 1;
            } else {
                count++;
            }
        } catch(err){
            console.log(err)
        }
    }

    useEffect(() => {   
        fetchAllInts()
        setTimeout(1000);
    })


    return (
        <div>
            <h1>Test Data</h1>
            <div className="data">
                
            </div>
        </div>
    )
}

export default Views;
